import IndexPage from "./Cover/IndexPage";
export default class Routes extends Component {
  render() {
    return (
      <div>
        <Router>
          <Route path="/index" exact component={Index} />
          <Route path="/" exact component={Home} />
        </Router>
      </div>
    );
  }
}
